Description.Desc:
Hold <IconMap:Icon_Normal> to activate:
Yidhari begins charging, continuously consuming HP during the charge. Up to three charge levels can be accumulated. Upon releasing <IconMap:Icon_Normal>, Yidhari unleashes a powerful charged hammer strike forward based on the current charge level, dealing massive <color=#98EFF0>Ice DMG</color>;
The more HP Yidhari has, the faster HP is consumed during charging, up to 25% of max HP;
After using this skill, press <IconMap:Icon_Normal> to immediately follow up with the third hit of <color=#FFFFFF>[Basic Attack: Crushing Despair Strike]</color>. When triggered this way, <color=#FFFFFF>[Basic Attack: Crushing Despair Strike]</color> DMG increases based on the current charge level, up to 30%.
At charge level 3, Anti-Interrupt is increased during this skill, and pressing <IconMap:Icon_Normal> allows for an early transition into the final plunging attack.

When hit by enemy attacks during the charge or spinning slash of <color=#FFFFFF>[Basic Attack: Frostbite Embrace]</color>, you can block with your tail to reduce incoming DMG by -0%;
If you are charging or haven't reached maximum charge levels, you'll use your tail to Counter the enemy's momentum, return to charging stance and instantly gain 1 charge level, dealing <color=#98EFF0>Ice DMG</color> to enemies in front;
During Frost's Crushing Weight, press <IconMap:Icon_Normal> and Yidhari will immediately execute the downward strike finisher of <color=#FFFFFF>[Basic Attack: Frostbite Embrace]</color> based on current charge level.
During Frost's Crushing Weight, press <IconMap:Icon_Special> or <IconMap:Icon_SpecialReady_Rp> and Yidhari will execute <color=#FFFFFF>[Special Attack: Frost Trace Crusher]</color> which guarantees [Frost Trace] activation

Press <IconMap:Icon_Special> to activate:
Launch enemies forward, dealing <color=#98EFF0>Ice DMG</color>;
Anti-Interrupt level is increased while using this skill.

When Adrenaline is sufficient, press <IconMap:Icon_SpecialReady_Rp> to activate:
Perform two consecutive uppercuts and unleash Icy Mist, dealing massive <color=#98EFF0>Ice DMG</color>;
[EX Special Attack: Frost Coil] If successfully hits enemies, restores HP equal to 33% of Yidhari's lost HP at the end of the skill;
Character is invulnerable while using this skill.

During the charge or horizontal swing of <color=#FFFFFF>[Basic Attack: Frost Embrace]</color>, press <IconMap:Icon_Special>, <IconMap:Icon_SpecialReady_Rp>, or while holding <IconMap:Icon_Normal>, press <IconMap:Icon_Special>, <IconMap:Icon_SpecialReady_Rp> to:
Launch enemies forward and deal <color=#98EFF0>Ice DMG</color>;
Trigger [Frost Trace] when the skill's attack and enemy attacks collide;
Trigger [Pursuit Crush] when the skill hits Stunned enemies;
When [Frost Trace] or [Pursuit Crush] is triggered, immediately increase charge level to maximum;
During this skill, press <IconMap:Icon_Normal> and Yidhari will immediately perform the downward slam finisher of <color=#FFFFFF>[Basic Attack: Frost Embrace]</color> based on the current charge level.
Anti-Interrupt level is increased while using this skill.

When [Frost Trace] or [Pursuit Crush] is triggered and you have enough Adrenaline, press <IconMap:Icon_SpecialReady_Rp> or <IconMap:Icon_Normal> to activate:
Dash forward, perform a quick upward slash and leap into the air, followed by a powerful downward smash, dealing massive <color=#98EFF0>Ice DMG</color>;
<color=#FFFFFF>[EX Special Attack: Glacial Crush]</color> Upon successfully hitting an enemy, HP will be restored at the end of the skill, recovering 33% of Yidhari's lost HP;
If activated after [Frost Trace], additionally recover 20 Adrenaline.
After using this skill, press <IconMap:Icon_Normal> to immediately perform the downward smash finisher of <color=#FFFFFF>[Basic Attack: Frostbite Embrace]</color> based on current charge level.
Character is invulnerable while using this skill.

When a <color=#FFFFFF>Chain Attack</color> is triggered, select the character to activate:
Unleashes a powerful strike at enemies in a small area in front, dealing massive <color=#98EFF0>Ice DMG</color>;
While in <color=#FFFFFF>[Ether Veil: Gushing Spring]</color>, summons tentacles for a Coordinated Attack, further enhancing the skill's power;
Character is invulnerable while using this skill.

When Yidhari consumes Decibels to activate <color=#FFFFFF>[Ether Veil: Gushing Spring]</color>, press <IconMap:Icon_UltimateReady> during <color=#FFFFFF>[Ether Veil: Gushing Spring]</color> to unleash:
A powerful strike dealing massive <color=#98EFF0>Ice DMG</color> to enemies in a large area in front;
Character is invulnerable while using this skill;
When Yidhari consumes Decibels to activate <color=#FFFFFF>[Ether Veil: Gushing Spring]</color>, she can use <color=#FFFFFF>[Ultimate: Final Act - Crossing the River of Regret]</color> once.

Desc:
Yidhari gains additional Sheer Force based on her max HP, gaining 0.1 Sheer Force for every point of max HP;
All <color=#98EFF0>Ice DMG</color> dealt by Yidhari's skills is converted to Sheer DMG, ignoring enemy defense and using Sheer Force as the skill DMG Multiplier; When entering combat, Yidhari immediately recovers 60 Adrenaline. In Investigation Zone mode, this effect can trigger once every 180 seconds,
The lower Yidhari's current HP percentage, the higher the DMG dealt by her skills;
When Yidhari's HP falls below 40%, the buff reaches its maximum effect, increasing attack DMG by up to <color=#2BAD00>40%</color>. After Yidhari's HP returns to 40%, the maximum buff will persist for 5 seconds;
Yidhari's Decibels decrease when hitting enemies with skills, and she gains Decibels proportionally when her HP decreases.

When another character in your squad has <color=#FFFFFF>[Stun]</color> or <color=#FFFFFF>[Assist]</color> effect:
When Yidhari's HP falls below 50%, CRIT DMG increases by 35% and DMG taken is reduced by 20%;
While Yidhari is under <color=#FFFFFF>[Ether Veil: Gushing Spring]</color>, gain the following additional effects:
After Yidhari's third charged attack of <color=#FFFFFF>[Basic Attack: Frostbite Embrace]</color> or <color=#FFFFFF>[EX Special Attack: Glacial Crush]</color>, summon tentacles to perform an attack, dealing additional DMG, triggering once every 12 seconds at most;
Using the above skills counts as using an <color=#FFFFFF>[EX Special Attack]</color>, with DMG Multiplier scaling with the Skill Lv. of EX Special Attack.

